import React, { Component } from 'react';

class Table extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            count: 0,
            imgUrl: 'https://picsum.photos/200'
         }
    }
    render() { 
        return (
            <React.Fragment>
                <img src={this.state.imgUrl}></img>
                <span className='badge badge-secondary m-2'>{ this.state.count }</span><button className='btn'>++</button>
            </React.Fragment>
        );

    }
}

export default Table;
